# reverse all the colormaps.
# reversed colormaps have '_r' appended to the name.

def _revcmap(data):
    data_r = {}
    for key,val in data.iteritems():
        val = list(val)
        valrev = val[::-1]
        valnew = []
        for a,b,c in valrev:
            valnew.append((1.-a,b,c))
        data_r[key]=valnew
    return data_r

